import React, { Component } from 'react';
import { connect } from 'react-redux';
import './SelfDesign.scss';
import { FormattedMessage } from 'react-intl';

import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import SelfDesignImg from "../../../assets/SelfDesign/biotope.jpg"

class SelfDesign extends Component {

    render() {

        let setting = {
            dots: false,
            infiniti: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 1
        }

        return (
            <div className='section-self-design'>
                <div className='self-design-content'>
                    <Slider {...setting}>
                        <div className='self-design-img'>
                            <img src={SelfDesignImg} />
