                            <img src={SelfDesignImg} />
                            <div>Hồ cá thủy sinh Biotope</div>
                        </div>
                        <div className='self-design-img'>
                            <img src={SelfDesignImg} />
                            <div>Hồ cá thủy sinh Biotope</div>
                        </div>
                        <div className='self-design-img'>
                            <img src={SelfDesignImg} />
                            <div>Hồ cá thủy sinh Biotope</div>
                        </div>
                    </Slider>
                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(SelfDesign);
